import React from 'react';
import './Header.css';
import GitHubIcon from './github.svg'; // Remplacez le chemin par le chemin réel de votre fichier SVG

function Header() {
    return (
        <header className="header">
            <ul>
                <li><a href="https://github.com/Bastctt"><img src={GitHubIcon} alt="GitHub Icon" /></a></li>
                <li><a href=""></a></li>
            </ul>
        </header>
    )
}

export default Header;
